	try {
		let trans = IndexedDB_db.transaction(storeName, "readwrite")
		trans.onerror = e => {
			core_log("Error in IndexedDB.save: "+trans.error)
			$else?.()
		}
		trans.objectStore(IndexedDB_storeName).put(data).onsuccess = e => {
			then?.()
		}
	} catch(e) {
		core_log("Error in IndexedDB.save: "+e.message)
		$else?.()
	}
